import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import home from './react/pages/home';
import { BrowserRouter, Switch, Route, Redirect } from 'react-router-dom';


//const PrivateRoute = ({component: Component, ...rest}) => (
