//        AutenticacaoSession.authorize() ? (
//            <Component {...props} />
//        ) : (
//            <Redirect to= {{ pathname: "/NotAuthenticated"}} />
//        )
//    )} /> 
//)


ReactDOM.render(
    <BrowserRouter>
        <Switch>
            <Route path='/' exact={true} component={home} />
        </Switch>
    </BrowserRouter>,
    document.getElementById('root')
)
